We use an underlying Key-Value database where we assume we have the following operations available: write(key, value) read(key) -> Option<value> iter_with_prefix(prefix) -> Iterator<(key, value)> - gives all keys and values in lexicographical order where the key starts with prefix. We use this database to encode the following schema: ("available", CandidateHash) -> Option<AvailableData>
("chunk", CandidateHash, u32) -> Option<ErasureChunk>
("meta", CandidateHash) -> Option<CandidateMeta> ("unfinalized", BlockNumber, BlockHash, CandidateHash) -> Option<()>
("prune_by_time", Timestamp, CandidateHash) -> Option<()> Timestamps are the wall-clock seconds since unix epoch. Timestamps and block numbers are both encoded as big-endian so lexicographic order is ascending. The meta information that we track per-candidate is defined as the CandidateMeta struct struct CandidateMeta { state: State, data_available: bool, chunks_stored: Bitfield,
